class Solution {

    /**
     * @param Integer $start
     * @param Integer $finish
     * @param Integer $limit
     * @param String $s
     * @return Integer
     */
    function numberOfPowerfulInt($start, $finish, $limit, $s) {
        $count = 0;
        $len = strlen($s);
        $num = (int)$s;
        if($num < $start || $num > $finish) return 0; // s itself is not in the range
        for($i = 0; $i <= $limit; $i++) {
            $current = (string)$i . $s;
            if($current >= $start && $current <= $finish) $count++;
        }
        $firstDigit = (int)$s[0];
        if($len == 1 || ($len > 1 && $firstDigit <= $limit)) {
            $prefix = 1;
            while(true) {
                for($i = 0; $i <= $limit; $i++) {
                    $current = (string)$i . $s;
                    for($j = 1; $j < $prefix; $j++) $current = "0" . $current;
                    if($current > $finish) return $count;
                    if($current >= $start && $current <= $finish) $count++;
                }
                $prefix++;
            }
        }
        return $count;
    }
}
